import {withRouter} from 'react-router-dom'

class App extends React.Component {
  handleSubmit() {
	this.props.history.push('/Home')
  }
  render() {
    return (
      <div>
        <h1>App.js</h1>
        <Form onSubmit={this.handleSubmit} />
      </div>
    )
  }
}

export default withRouter(App)
